import React, { useEffect, useState } from 'react'
import Swal from 'sweetalert2'

const Product = () => {
    const[pname,setpname]=useState()
    const[pq,setpq]=useState()
    const[pimg,setpimg]=useState()
    const[pfetch,setpfetch]=useState([])
    const[catid,setcatid]=useState()
    const[subid,setsubid]=useState()
    const[clist,setclist]=useState([])
    const[sublist,setsublist]=useState([])
    const[pprice,setprice]=useState()
    const[pdescription,setdescription]=useState()
    const[productid,setproductid]=useState()
    const[oldpic,setoldpic]=useState()

    useEffect(()=>{
        data();
        datasub();
        data1()
    },[])

    const showSuccessAlert = (message) => {
        Swal.fire({
            icon: 'success',
            title: 'Success',
            text: message,
            timer: 2000,
            showConfirmButton: false
        });
    }

    const showErrorAlert = (message) => {
        Swal.fire({
            icon: 'error',
            title: 'Error',
            text: message
        });
    }

    const show=async()=>{
        const formdata=new FormData()
        formdata.append("catid",catid)
        formdata.append("subid",subid)
        formdata.append("pname1",pname)
        formdata.append("pq1",pq)
        formdata.append("pimg1",pimg)
        formdata.append("pprice",pprice)
        formdata.append("pdescription",pdescription)
        try{
            const res=await fetch("http://localhost:9000/api/product",{
                method:"post",
                body:formdata
            })
            if(res.ok){
                const result= await res.json()
                if(result.statuscode===1){
                    showSuccessAlert("Product added successfully")
                }
                else{
                    showErrorAlert("Failed to add product")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "An error occurred")
        }
    }

    const data=async()=>{
        try{
            const res=await fetch("http://localhost:9000/api/category1",{
                method:"get"
            })
            if(res.ok){
                const result=await res.json()
                if(result){
                    setclist(result.data1)
                }
                else{
                    showErrorAlert("Error fetching categories")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "Error fetching categories")
        }
    }

    const data1=async()=>{
        try{
            const res=await fetch("http://localhost:9000/api/product1",{
                method:"get"
            })
            if(res.ok){
                const result=await res.json()
                if(result){
                    setpfetch(result.dd)
                }
                else{
                    showErrorAlert("Error fetching products")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "Error fetching products")
        }
    }

    const datasub=async()=>{
        try{
            const res=await fetch("http://localhost:9000/api/subcat",{
                method:"get"
            })
            if(res.ok){
                const result=await res.json()
                if(result){
                    setsublist(result.dd)
                }
                else{
                    showErrorAlert("Error fetching subcategories")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "Error fetching subcategories")
        }
    }

    const del=async(pid)=>{
        try{
            const res= await fetch(`http://localhost:9000/api/pdelete/${pid}`,{
                method:"delete"
            })
            if(res.ok){
                const result= await res.json()
                if(result.statuscode===1){
                    setpfetch([])
                    data1()
                    showSuccessAlert("Product deleted successfully")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "Error deleting product")
        }
    }

    const onupdate=(pdata)=>{
        setpname(pdata.pname)
        setpq(pdata.pq)
        setprice(pdata.pprice)
        setdescription(pdata.pdescription)
        setproductid(pdata._id)
        setoldpic(pdata.pimg)
    }

    const update=async()=>{
        const formdata=new FormData()
        formdata.append("pname",pname)
        formdata.append("pq",pq)
        formdata.append("pimg",pimg)
        formdata.append("pprice",pprice)
        formdata.append("pdescription",pdescription)
        formdata.append("oldpic",oldpic)
        formdata.append("productid",productid)
        try{
            const res= await fetch("http://localhost:9000/api/productupdate",{
                method:"put",
                body:formdata
            })
            if(res.ok){
                const result=await res.json()
                if(result.statuscode===1){
                    setpfetch([])
                    data1()
                    setpname('');
                    setpq('');
                    setprice('');
                    setdescription('');
                    showSuccessAlert("Product updated successfully")
                }
                else{
                    showErrorAlert("Failed to update product")
                }
            }
        }catch(err){
            showErrorAlert(err.message || "Error updating product")
        }
    }

    // ... rest of your component code remains the same ...
    return (
        <div>
            {/* Your existing JSX remains unchanged */}
        </div>
    )
}

export default Product
